<form onSubmit={handleSubmit} className="product-form">
      <div className="form-group">
        <label htmlFor="name">Name:</label>
        <input
          type="text"
          className="form-control"
          id="name"
          name="name"
          value={product.name}
          onChange={handleInputChange}
          required
        />
      </div>
      <div className="form-group">
        <label htmlFor="price">Price:</label>
        <input
          type="number"
          className="form-control"
          id="price"
          name="price"
          value={product.price}
          onChange={handleInputChange}
          required
        />
      </div>
      <div className="form-group">
        <label htmlFor="quantity">Quantity:</label>
        <input
          type="number"
          className="form-control"
          id="quantity"
          name="quantity"
          value={product.quantity}
          onChange={handleInputChange}
          required
        />
      </div>
      <div className="form-group">
        <label htmlFor="image">Image:</label>
        <input
          type="file"
          className="form-control-file"
          id="image"
          name="image"
          onChange={handleImage}
          required
        />
      </div>
      <div className="form-group">
        <label htmlFor="rating">Rating:</label>
        <div>
          {product.rating.map((rate, index) => (
            <input
              type="number"
              className="form-control-rating"
              id={`rating-${index}`}
              name={`rating-${index}`}
              key={`rating-${index}`}
              value={rate}
              onChange={(e) => {
                const updatedRating = [...product.rating];
                updatedRating[index] = parseInt(e.target.value);
                setProduct({ ...product, rating: updatedRating });
              }}
              min="0"
              max="5"
              required
            />
          ))}
        </div>
      </div>
      <button type="submit" className="btn btn-primary">Add Product</button>
      <button onClick={BackButton} className="btn btn-primary">Back</button>

    </form>
    </div>
  );
};

export default AddProduct;
